import React from "react";
import styles from './Community.module.css';
import Community_Avatar from "../components/Community_Avatar";
import logo from '../images/React.png'
import Community_icon1 from "../images/wallpapersden.com_macos-12-monterey-stock-dark_3840x2160.jpg"

export default function Community(){
    return  (
    <div>
        <div className={styles.grid_container}>
            <div className={styles.profile_icon}>
                <Community_Avatar img={logo} />
                <center><div className={styles.line}></div></center>
                <Community_Avatar img={logo} />
                <Community_Avatar img={logo} />
            </div>
            <div className={styles.communities}></div>
            <div className={styles.chat}></div>
        </div>
    </div>
    );
}
